import './ExpenseItems.css'

function ExpenseItem() {
    return (
        <div>
            <div>June 16, 2023</div>
            <div>
                <h2>Car Insurance</h2>
                <div>$500</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
